CREATE TABLE `treatment` (
  `altid` char(2) NOT NULL DEFAULT 'TI',
  `tid` int(11) NOT NULL AUTO_INCREMENT,
  `treatment_pid` int(11) NOT NULL,
  `treatment_docid` int(11) NOT NULL,
  `treatment_vid` int(11) NOT NULL,
  `follow_up_info` varchar(30) DEFAULT NULL,
  `summary` varchar(2000) DEFAULT NULL,
  `prescription_pdf` mediumblob,
  PRIMARY KEY (`tid`),
  UNIQUE KEY `altid` (`altid`,`tid`),
  KEY `treatment_pid` (`treatment_pid`),
  KEY `treatment_docid` (`treatment_docid`),
  KEY `treatment_vid` (`treatment_vid`),
  CONSTRAINT `treatment_ibfk_1` FOREIGN KEY (`treatment_pid`) REFERENCES `patient` (`pid`),
  CONSTRAINT `treatment_ibfk_2` FOREIGN KEY (`treatment_docid`) REFERENCES `doctor` (`docid`),
  CONSTRAINT `treatment_ibfk_3` FOREIGN KEY (`treatment_vid`) REFERENCES `visit` (`vid`)
